import axios from "axios";

const userAutoLogIn = (refreshToken: string) => {
    return axios.post("https://journey-timeline-backend.up.railway.app/autologin", {
        refreshToken
    }, {
        withCredentials: true
    })
        .then((res) => res.data)
        .catch(() => null);
}

export default userAutoLogIn;
